// import React from 'react';
import Card from '../Card/index.jsx';
import styles from "../Cards/index.module.css"

const Cards = ({characters}) => {
   // const ({keyCharacter, id, name, status, species, gender, origin, image}) => 

   return (
   <div className={styles.cartas}>
      {characters.map(
         (props) => {
         return (

         <div key ={props.id}>
         <Card
         // id={props.id}
         name={props.name}
         status={props.status}
         species={props.species}
         gender={props.gender}
         origin={props.origin.name}
         image={props.image}
         onClose={() => window.alert("Emulamos que se cierra la card")}
         />
         </div>
         )}
      )}
   </div>
   )
}

export default Cards;
